import * as React from 'react';
import { CssBaseline } from '@mui/material';
import Button from '@mui/material/Button';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Link from '@mui/material/Link';
import './css/style.css'
import Heading from './Heading';
import ProTip from './ProTip';
import Grid from '@mui/material/Unstable_Grid2'; // Grid version 2
import { createTheme } from '@mui/material/styles';
import TextField1 from './TextField1';
import TextField2 from './TextField2';
import ExchangeButton from './ExchangeButton';
import TextField3 from './TextField3';
import TextField4 from './TextField4';


const theme = createTheme({
  status: {
    danger: '#e53e3e',
  },
  palette: {
    primary: {
      main: '#1a1526',
      darker: '#053e85',
    },
    neutral: {
      main: '#ff0a33',
      contrastText: '#fff',
    },
  },
});


function OnlineTradingButton() {
  return (
    <Button variant="contained" className='button1' color='primary'>
      Online trading
    </Button>
  )
}


export default function App() {
  return (
    <Container maxWidth='fixed' className='mainContainer'>
      <CssBaseline />
      <Grid container spacing={1}>
        {/* Header */}
        <Grid xs={7}>
          <Heading />
        </Grid>
        {/* Online trading button */}
        <Grid xs={5}>
          <OnlineTradingButton />
        </Grid>
        {/* Form  */}
        <Grid xs={12}>
          <div className='box'>
            <Grid container spacing={3}>
              <Grid xs={5.5} display="flex" justifyContent="" flexDirection={'column'} gap={'16px'} marginBottom='30px'>
                <TextField1 />
                <TextField3 />
              </Grid>
              <Grid xs={1} display="flex" justifyContent="center" alignItems='center'>
                <ExchangeButton />
              </Grid>
              <Grid xs={5.5} display="flex" justifyContent="center" flexDirection={'column'} gap={'16px'}>
                <TextField2 />
                <TextField4 />
              </Grid>
            </Grid>
          </div>
        </Grid>
      </Grid>
    </Container>
  );
}
